import React from 'react'
import { Button, Form, Input, Row, Col, Image, Typography, Modal } from 'antd';

export default function IdentityCard() {
  return (
    <div className='id'>
      <h1>Tờ khai căn cước công dân trực tuyến</h1>
      {/* 
      - Họ tên : text - giới tính : radio
      - ngày tháng năm sinh : date - Nơi đăng ký khai sinh: text
      - số CCCD/CMND : number (10 hoặc 12 số)
      - Dân tộc : text - Tôn giáo : text - Quốc tịch : text
      - Tình trạng hôn nhân : radio
      - Quê quán : text
      - Nơi thường trú : text
      - Nơi ở hiện tại : text
      */}
      
      <Form
              name="basic"
              labelCol={{ span: 8 }}
              wrapperCol={{ span: 16 }}
              style={{ maxWidth: 600 }}
              initialValues={{ remember: true }}
              
              autoComplete="off"
            >
              <Form.Item
                label="email"
                name="email"
                rules={[{ required: true, message: 'Please input your email!' }]}
              >
                <Input placeholder='Email'  />
              </Form.Item>
              
            </Form>
      

    </div>
  )
}
